'use server'

import { revalidateTag } from 'next/cache'
import { auth } from '@clerk/nextjs/server'
import {
  ofacScreeningSchema,
  ofacMonitoringSchema,
  ofacBatchSchema,
  ofacReviewSchema,
  type OFACScreeningData,
  type OFACMonitoringData,
  type OFACBatchData,
  type OFACReviewData,
  RateLimiter
} from '@/lib/schemas'
import { logger } from '@/lib/logger'
import { validateCsrfFromFormData } from '@/app/_lib/csrf'
import { ZodError } from 'zod'

// Types from validators (keeping for backwards compatibility)

interface ScreeningResult {
  id: string
  businessName: string
  status: 'clear' | 'potential_match' | 'match'
  riskLevel: 'low' | 'medium' | 'high'
  matches: Array<{
    name: string
    type: string
    score: number
  }>
  createdAt: string
}

// Helper function to get auth session
async function getAuthSession() {
  return await auth()
}

// Timeout configuration based on operation type
const TIMEOUT_CONFIG = {
  SCREENING: 30000,    // 30s - OFAC screening operations
  MONITORING: 30000,   // 30s - Monitoring setup
  BATCH: 60000,        // 60s - Batch processing (report generation)
  REVIEW: 10000,       // 10s - Quick review submissions
}

// Helper function to determine timeout based on endpoint
function getTimeoutForEndpoint(endpoint: string): number {
  if (endpoint.includes('/screen')) return TIMEOUT_CONFIG.SCREENING
  if (endpoint.includes('/monitoring')) return TIMEOUT_CONFIG.MONITORING
  if (endpoint.includes('/batch')) return TIMEOUT_CONFIG.BATCH
  if (endpoint.includes('/review')) return TIMEOUT_CONFIG.REVIEW
  return 30000 // Default 30s
}

// Helper function to make API calls with secure JWT tokens
async function makeAPICall<T>(
  endpoint: string,
  options: RequestInit = {}
): Promise<{ success: boolean; data?: T; error?: string }> {
  const timeout = getTimeoutForEndpoint(endpoint)
  const controller = new AbortController()
  const timeoutId = setTimeout(() => controller.abort(), timeout)

  try {
    const { userId, getToken } = await getAuthSession()
    if (!userId) {
      clearTimeout(timeoutId)
      return { success: false, error: 'Authentication required' }
    }

    // Get the secure JWT access token from Clerk
    const accessToken = await getToken()
    if (!accessToken) {
      logger.error('No access token from Clerk')
      clearTimeout(timeoutId)
      return { success: false, error: 'Invalid authentication token' }
    }

    // Get API base URL from environment variables with proper fallback
    const getApiBaseUrl = (): string => {
      if (process.env['API_BASE_URL']) {
        return process.env['API_BASE_URL']
      }

      // Development fallback - only in development environment
      if (process.env['NODE_ENV'] === 'development') {
        return 'http://localhost:3001'
      }

      // Production should always have proper environment variables set
      throw new Error('API_BASE_URL must be configured in production')
    }

    const baseURL = getApiBaseUrl()
    const response = await fetch(`${baseURL}${endpoint}`, {
      headers: {
        'Content-Type': 'application/json',
        'Authorization': `Bearer ${accessToken}`, // Use secure JWT token
        ...options.headers,
      },
      cache: 'no-store',
      signal: controller.signal,
      ...options,
    })

    clearTimeout(timeoutId)

    if (!response.ok) {
      const errorData = await response.text()
      return {
        success: false,
        error: `API Error: ${response.status} - ${errorData}`,
      }
    }

    const data = await response.json()
    return { success: true, data }
  } catch (error) {
    clearTimeout(timeoutId)

    // Handle timeout specifically
    if (error instanceof Error && error.name === 'AbortError') {
      logger.error('API call timeout', { endpoint, timeout })
      return {
        success: false,
        error: `Request timeout: The OFAC operation took longer than expected (${timeout / 1000}s). Please try again.`,
      }
    }

    logger.error('API call failed', error)
    return {
      success: false,
      error: error instanceof Error ? error.message : 'Unknown error occurred',
    }
  }
}

// Server Actions
export async function performOFACScreening(
  prevState: any,
  formData: FormData
): Promise<{ success: boolean; data?: ScreeningResult | null; error?: string | null }> {
  try {
    // TEMPORARY: CSRF and auth checks disabled for testing
    logger.info('[OFAC Screening] Starting screening request')

    // Rate limiting check
    const { userId } = await getAuthSession()
    const userIdForRateLimit = userId || 'test-user-id'

    logger.info('[OFAC Screening] User ID:', { userId: userIdForRateLimit })

    if (!RateLimiter.checkLimit(`ofac_screening_${userIdForRateLimit}`, 20, 3600000)) { // 20 requests per hour
      return {
        success: false,
        data: null,
        error: 'Too many OFAC screening requests. Please wait before trying again.'
      }
    }

    // Extract raw data from FormData
    const rawData = {
      searchType: formData.get('searchType') || 'business',

      // Business fields
      businessName: formData.get('businessName') || undefined,
      businessType: formData.get('businessType') || undefined,
      primaryContact: formData.get('primaryContact') || undefined,

      // Individual fields
      individualName: formData.get('individualName') || undefined,
      dateOfBirth: formData.get('dateOfBirth') || undefined,
      placeOfBirth: formData.get('placeOfBirth') || undefined,
      nationality: formData.get('nationality') || undefined,
      citizenship: formData.get('citizenship') || undefined,

      // Common fields
      country: formData.get('country') || undefined,

      // Optional enhanced screening fields
      additionalNames: formData.get('additionalNames') ?
        JSON.parse(formData.get('additionalNames') as string) : undefined,
      addresses: formData.get('addresses') ?
        JSON.parse(formData.get('addresses') as string) : undefined,
      identifiers: formData.get('identifiers') ?
        JSON.parse(formData.get('identifiers') as string) : undefined,
      screeningOptions: formData.get('screeningOptions') ?
        JSON.parse(formData.get('screeningOptions') as string) : undefined,
    }

    logger.info('[OFAC Screening] Raw form data', { searchType: rawData.searchType })

    // Validate and sanitize input using Zod schema
    const screeningData = ofacScreeningSchema.parse(rawData)
    logger.info('[OFAC Screening] Validation passed', {
      searchType: screeningData.searchType,
      businessName: screeningData.businessName,
      individualName: screeningData.individualName
    })

    // Make API call to perform the screening
    logger.info('[OFAC Screening] Making API call to /api/ofac/screen')
    const result = await makeAPICall<ScreeningResult>('/api/ofac/screen', {
      method: 'POST',
      body: JSON.stringify({
        searchType: screeningData.searchType,
        businessName: screeningData.businessName,
        businessType: screeningData.businessType,
        primaryContact: screeningData.primaryContact,
        individualName: screeningData.individualName,
        dateOfBirth: screeningData.dateOfBirth,
        placeOfBirth: screeningData.placeOfBirth,
        nationality: screeningData.nationality,
        citizenship: screeningData.citizenship,
        country: screeningData.country,
        additionalNames: screeningData.additionalNames,
        addresses: screeningData.addresses,
        identifiers: screeningData.identifiers,
        timestamp: new Date().toISOString(),
      }),
    })

    logger.info('[OFAC Screening] API call result', { success: result.success, hasData: !!result.data })

    if (!result.success) {
      logger.error('[OFAC Screening] API call failed', { error: result.error })
      return { success: false, error: result.error || 'Unknown error' }
    }

    // Revalidate relevant caches
    revalidateTag('ofac-data')
    revalidateTag('ofac-screenings')

    logger.info('[OFAC Screening] Screening completed successfully')
    return { success: true, data: result.data || null, error: null }
  } catch (error) {
    logger.error('OFAC screening failed', error)

    // Handle validation errors specifically
    if (error instanceof ZodError) {
      const errorMessages = error.issues.map(err => `${err.path.join('.')}: ${err.message}`).join(', ')
      logger.error('[OFAC Screening] Validation error', { errorMessages })
      return {
        success: false,
        data: null,
        error: `Validation error: ${errorMessages}`,
      }
    }

    return {
      success: false,
      data: null,
      error: 'Failed to perform OFAC screening. Please try again.',
    }
  }
}

// OFAC monitoring setup action
export async function setupOFACMonitoring(
  prevState: any,
  formData: FormData
): Promise<{ success: boolean; data?: { monitoringId: string } | null; error?: string | null }> {
  try {
    // CSRF Protection: Verify token before processing
    const csrfValidation = await validateCsrfFromFormData(formData)
    if (!csrfValidation.success) {
      logger.authEvent('csrf_validation_failed', undefined, 'ofac_monitoring')
      return {
        success: false,
        data: null,
        error: csrfValidation.error || 'Security validation failed',
      }
    }

    // Rate limiting check
    const { userId } = await getAuthSession()
    if (!userId) {
      return { success: false, error: 'Authentication required' }
    }
    if (!RateLimiter.checkLimit(`ofac_monitoring_${userId}`, 5, 3600000)) { // 5 requests per hour
      return {
        success: false,
        data: null,
        error: 'Too many monitoring setup requests. Please wait before trying again.'
      }
    }

    // Extract raw data from FormData
    const rawData = {
      businessName: formData.get('businessName'),
      monitoringFrequency: formData.get('monitoringFrequency'),
      alertThreshold: formData.get('alertThreshold'),
      notificationEmail: formData.get('notificationEmail'),
      includeWatchlists: formData.get('includeWatchlists') ?
        JSON.parse(formData.get('includeWatchlists') as string) : [],
      active: formData.get('active') === 'true',
    }

    // Validate and sanitize input using Zod schema
    const monitoringData = ofacMonitoringSchema.parse(rawData)

    // Log the monitoring setup attempt
    logger.info('Setting up OFAC monitoring', { businessName: monitoringData.businessName })

    // Make API call to setup monitoring
    const result = await makeAPICall<{ monitoringId: string }>('/api/ofac/monitoring', {
      method: 'POST',
      body: JSON.stringify({
        ...monitoringData,
        timestamp: new Date().toISOString(),
      }),
    })

    if (!result.success) {
      return { success: false, error: result.error || 'Unknown error' }
    }

    // Revalidate relevant caches
    revalidateTag('ofac-monitoring')
    revalidateTag('ofac-data')

    return { success: true, data: result.data || null, error: null }
  } catch (error) {
    logger.error('OFAC monitoring setup failed', error)

    // Handle validation errors specifically
    if (error instanceof ZodError) {
      const errorMessages = error.issues.map(err => `${err.path.join('.')}: ${err.message}`).join(', ')
      return {
        success: false,
        data: null,
        error: `Validation error: ${errorMessages}`,
      }
    }

    return {
      success: false,
      data: null,
      error: 'Failed to setup OFAC monitoring. Please try again.',
    }
  }
}

// OFAC batch processing action
export async function processBatchScreening(
  prevState: any,
  formData: FormData
): Promise<{ success: boolean; data?: { batchId: string } | null; error?: string | null }> {
  try {
    // CSRF Protection: Verify token before processing
    const csrfValidation = await validateCsrfFromFormData(formData)
    if (!csrfValidation.success) {
      logger.authEvent('csrf_validation_failed', undefined, 'ofac_batch')
      return {
        success: false,
        data: null,
        error: csrfValidation.error || 'Security validation failed',
      }
    }

    // Rate limiting check
    const { userId } = await getAuthSession()
    if (!userId) {
      return { success: false, error: 'Authentication required' }
    }
    if (!RateLimiter.checkLimit(`ofac_batch_${userId}`, 2, 3600000)) { // 2 requests per hour
      return {
        success: false,
        data: null,
        error: 'Too many batch processing requests. Please wait before trying again.'
      }
    }

    // Extract raw data from FormData
    const rawData = {
      batchName: formData.get('batchName'),
      entities: formData.get('entities') ? JSON.parse(formData.get('entities') as string) : [],
      processingOptions: formData.get('processingOptions') ?
        JSON.parse(formData.get('processingOptions') as string) : {},
    }

    // Validate and sanitize input using Zod schema
    const batchData = ofacBatchSchema.parse(rawData)

    // Log the batch processing attempt
    logger.info('Processing OFAC batch', {
      batchName: batchData.batchName,
      entityCount: batchData.entities.length
    })

    // Make API call to process batch
    const result = await makeAPICall<{ batchId: string }>('/api/ofac/batch', {
      method: 'POST',
      body: JSON.stringify({
        ...batchData,
        timestamp: new Date().toISOString(),
      }),
    })

    if (!result.success) {
      return { success: false, error: result.error || 'Unknown error' }
    }

    // Revalidate relevant caches
    revalidateTag('ofac-batch')
    revalidateTag('ofac-data')

    return { success: true, data: result.data || null, error: null }
  } catch (error) {
    logger.error('OFAC batch processing failed', error)

    // Handle validation errors specifically
    if (error instanceof ZodError) {
      const errorMessages = error.issues.map(err => `${err.path.join('.')}: ${err.message}`).join(', ')
      return {
        success: false,
        data: null,
        error: `Validation error: ${errorMessages}`,
      }
    }

    return {
      success: false,
      data: null,
      error: 'Failed to process OFAC batch. Please try again.',
    }
  }
}

// OFAC review decision action
export async function submitOFACReview(
  prevState: any,
  formData: FormData
): Promise<{ success: boolean; data?: { reviewId: string } | null; error?: string | null }> {
  try {
    // CSRF Protection: Verify token before processing
    const csrfValidation = await validateCsrfFromFormData(formData)
    if (!csrfValidation.success) {
      logger.authEvent('csrf_validation_failed', undefined, 'ofac_review')
      return {
        success: false,
        data: null,
        error: csrfValidation.error || 'Security validation failed',
      }
    }

    // Rate limiting check
    const { userId } = await getAuthSession()
    if (!userId) {
      return { success: false, error: 'Authentication required' }
    }
    if (!RateLimiter.checkLimit(`ofac_review_${userId}`, 50, 3600000)) { // 50 requests per hour
      return {
        success: false,
        data: null,
        error: 'Too many review requests. Please wait before trying again.'
      }
    }

    // Extract raw data from FormData
    const rawData = {
      screeningId: formData.get('screeningId'),
      decision: formData.get('decision'),
      reviewNotes: formData.get('reviewNotes'),
      riskRating: formData.get('riskRating'),
      followUpRequired: formData.get('followUpRequired') === 'true',
      followUpDate: formData.get('followUpDate'),
      escalationReason: formData.get('escalationReason'),
      attachments: formData.get('attachments') ?
        JSON.parse(formData.get('attachments') as string) : [],
    }

    // Validate and sanitize input using Zod schema
    const reviewData = ofacReviewSchema.parse(rawData)

    // Log the review submission attempt
    logger.info('Submitting OFAC review', {
      screeningId: reviewData.screeningId,
      decision: reviewData.decision
    })

    // Make API call to submit review
    const result = await makeAPICall<{ reviewId: string }>('/api/ofac/review', {
      method: 'POST',
      body: JSON.stringify({
        ...reviewData,
        timestamp: new Date().toISOString(),
      }),
    })

    if (!result.success) {
      return { success: false, error: result.error || 'Unknown error' }
    }

    // Revalidate relevant caches
    revalidateTag('ofac-reviews')
    revalidateTag('ofac-data')

    return { success: true, data: result.data || null, error: null }
  } catch (error) {
    logger.error('OFAC review submission failed', error)

    // Handle validation errors specifically
    if (error instanceof ZodError) {
      const errorMessages = error.issues.map(err => `${err.path.join('.')}: ${err.message}`).join(', ')
      return {
        success: false,
        data: null,
        error: `Validation error: ${errorMessages}`,
      }
    }

    return {
      success: false,
      data: null,
      error: 'Failed to submit OFAC review. Please try again.',
    }
  }
}

// Utility action for refreshing OFAC data
export async function refreshOFACData() {
  revalidateTag('ofac-data')
  revalidateTag('ofac-screenings')
  revalidateTag('ofac-monitoring')
  revalidateTag('ofac-batch')
  revalidateTag('ofac-reviews')
}

// This file is automatically synced from api-server/src/schemas/ofac.ts
// Do not edit this file directly - make changes in the api-server source
// Run 'npm run sync-schemas' to update

import { z } from 'zod'
import { secureText } from './security'

/**
 * OFAC validation schemas with comprehensive security measures
 */

// Business types for OFAC screening
const businessTypeSchema = z.enum([
  'corporation',
  'llc',
  'partnership',
  'sole_proprietorship',
  'non_profit',
  'government',
  'financial_institution',
  'money_service_business',
  'virtual_currency_business',
  'other'
], { errorMap: () => ({ message: 'Please select a valid business type' }) })

// Country validation for OFAC (more restrictive than general country codes)
const ofacCountrySchema = z.string()
  .length(2, 'Country code must be exactly 2 characters')
  .regex(/^[A-Z]{2}$/, 'Country code must be uppercase letters only')
  .refine(
    (code) => {
      // Add validation for sanctioned countries if needed
      const sanctionedCountries = ['IR', 'KP', 'SY', 'CU'] // Example sanctioned countries
      // This could be expanded based on current OFAC sanctions
      return true // For now, allow all countries but flag sanctioned ones
    },
    { message: 'Country may be subject to OFAC sanctions' }
  )

// Optional country schema that allows empty strings
const ofacCountryOptionalSchema = z.string()
  .optional()
  .refine(
    (val) => {
      if (!val || val.trim() === '') return true
      return val.length === 2 && /^[A-Z]{2}$/.test(val)
    },
    { message: 'Country code must be exactly 2 uppercase letters' }
  )

// Primary contact name validation (stricter for OFAC compliance)
const primaryContactSchema = secureText(100)
  .refine(val => val.length >= 2, 'Primary contact name must be at least 2 characters')
  .refine(
    (name) => {
      // Ensure it contains at least one letter and doesn't look like random text
      return /[a-zA-Z]/.test(name) && !/^[0-9\s\-_.]+$/.test(name)
    },
    { message: 'Primary contact must be a valid person name' }
  )

// OFAC screening validation schema - supports flexible searching for businesses and individuals
export const ofacScreeningSchema = z.object({
  // Search type selector
  searchType: z.enum(['business', 'individual'], {
    errorMap: () => ({ message: 'Search type must be either business or individual' })
  }),

  // Business fields (optional when searchType is 'business')
  businessName: secureText(200)
    .optional()
    .refine(
      (name) => {
        // Allow empty/undefined, otherwise validate
        if (!name || name.trim() === '') return true
        // Business name should contain letters and not be just numbers/symbols
        return /[a-zA-Z]/.test(name) && name.trim().length >= 2
      },
      { message: 'Business name must contain letters and be meaningful' }
    ),

  businessType: businessTypeSchema.optional(),

  // Individual fields (optional when searchType is 'individual')
  individualName: secureText(200)
    .optional()
    .refine(
      (name) => {
        // Allow empty/undefined, otherwise validate
        if (!name || name.trim() === '') return true
        // Individual name should contain letters
        return /[a-zA-Z]/.test(name) && name.trim().length >= 2
      },
      { message: 'Individual name must contain letters and be meaningful' }
    ),

  dateOfBirth: z.string()
    .optional()
    .refine(
      (val) => !val || val.trim() === '' || /^\d{4}-\d{2}-\d{2}$/.test(val),
      { message: 'Date of birth must be in YYYY-MM-DD format' }
    ),

  placeOfBirth: secureText(100).optional(),

  nationality: secureText(100).optional(),

  citizenship: secureText(100).optional(),

  // Legacy field - kept for backwards compatibility
  primaryContact: primaryContactSchema.optional(),

  // Country (optional for both types)
  country: ofacCountryOptionalSchema,

  // Optional additional fields for enhanced screening (both types)
  additionalNames: z.array(secureText(100))
    .max(10, 'Maximum 10 additional names allowed')
    .optional()
    .transform((names) => names?.filter(name => name && name.trim().length > 0) || []),

  addresses: z.array(z.object({
    street: secureText(200).refine(val => val.length >= 5, 'Street address must be at least 5 characters'),
    city: secureText(50).refine(val => val.length >= 2, 'City must be at least 2 characters'),
    state: secureText(50).optional(),
    postalCode: secureText(20).optional(),
    country: ofacCountrySchema,
  }))
    .max(5, 'Maximum 5 addresses allowed')
    .optional()
    .default([]),

  identifiers: z.array(z.object({
    type: z.enum([
      'tax_id',
      'registration_number',
      'license_number',
      'passport',
      'national_id',
      'ssn',
      'other'
    ]),
    value: secureText(50).refine(val => val.length >= 3, 'Identifier must be at least 3 characters'),
    country: ofacCountrySchema.optional(),
  }))
    .max(5, 'Maximum 5 identifiers allowed')
    .optional()
    .default([]),

  // Screening options
  screeningOptions: z.object({
    includeAlternateNames: z.boolean().default(true),
    includeFuzzyMatching: z.boolean().default(false), // Disabled by default (simplified)
    includePhoneticMatching: z.boolean().default(false),
    confidenceThreshold: z.number()
      .min(0.1, 'Confidence threshold must be at least 0.1')
      .max(1.0, 'Confidence threshold must be at most 1.0')
      .default(0.8),
  }).optional().default({}),
}).refine(
  (data) => {
    // At least ONE search field must be provided
    const hasBusinessName = data.businessName && data.businessName.trim().length >= 2
    const hasIndividualName = data.individualName && data.individualName.trim().length >= 2
    const hasIdentifiers = data.identifiers && data.identifiers.length > 0
    const hasAdditionalNames = data.additionalNames && data.additionalNames.length > 0
    const hasAddresses = data.addresses && data.addresses.length > 0
    const hasDateOfBirth = data.dateOfBirth && data.dateOfBirth.length > 0
    const hasNationality = data.nationality && data.nationality.trim().length > 0

    return hasBusinessName ||
           hasIndividualName ||
           hasIdentifiers ||
           hasAdditionalNames ||
           hasAddresses ||
           hasDateOfBirth ||
           hasNationality
  },
  {
    message: 'Please provide at least one search criteria (name, identifier, date of birth, nationality, or address)',
    path: ['businessName'] // Show error on the first field
  }
).refine(
  (data) => {
    // Validate that business fields are provided when searchType is 'business'
    if (data.searchType === 'business') {
      const hasBusinessName = data.businessName && data.businessName.trim().length >= 2
      const hasIdentifiers = data.identifiers && data.identifiers.length > 0
      const hasAdditionalNames = data.additionalNames && data.additionalNames.length > 0

      return hasBusinessName || hasIdentifiers || hasAdditionalNames
    }
    return true
  },
  {
    message: 'For business searches, please provide at least business name, identifier, or additional name',
    path: ['businessName']
  }
).refine(
  (data) => {
    // Validate that individual fields are provided when searchType is 'individual'
    if (data.searchType === 'individual') {
      const hasIndividualName = data.individualName && data.individualName.trim().length >= 2
      const hasIdentifiers = data.identifiers && data.identifiers.length > 0
      const hasDateOfBirth = data.dateOfBirth && data.dateOfBirth.length > 0
      const hasNationality = data.nationality && data.nationality.trim().length > 0

      return hasIndividualName || hasIdentifiers || hasDateOfBirth || hasNationality
    }
    return true
  },
  {
    message: 'For individual searches, please provide at least name, identifier, date of birth, or nationality',
    path: ['individualName']
  }
)

// OFAC monitoring setup validation schema
export const ofacMonitoringSchema = z.object({
  businessName: secureText(200).refine(val => val.length >= 2, 'Business name is required'),

  monitoringFrequency: z.enum([
    'daily',
    'weekly',
    'monthly',
    'quarterly',
    'on_demand'
  ], { errorMap: () => ({ message: 'Please select a valid monitoring frequency' }) }),

  alertThreshold: z.enum([
    'any_match',
    'high_confidence',
    'exact_match_only'
  ], { errorMap: () => ({ message: 'Please select a valid alert threshold' }) }),

  notificationEmail: z.string()
    .email('Invalid email format')
    .max(254, 'Email must be 254 characters or less'),

  includeWatchlists: z.array(z.enum([
    'sdn',           // Specially Designated Nationals
    'consolidated',  // Consolidated Sanctions List
    'sectoral',      // Sectoral Sanctions Identifications
    'fse',          // Foreign Sanctions Evaders
    'isa',          // Iranian Sanctions Act
    'pep',          // Politically Exposed Persons
    'custom'        // Custom watch lists
  ])).min(1, 'At least one watchlist must be selected'),

  active: z.boolean().default(true),
})

// OFAC batch processing validation schema
export const ofacBatchSchema = z.object({
  batchName: secureText(100).refine(val => val.length >= 3, 'Batch name must be at least 3 characters'),

  entities: z.array(z.object({
    id: secureText(50).refine(val => val.length >= 1, 'Entity ID is required'),
    name: secureText(200).refine(val => val.length >= 2, 'Entity name must be at least 2 characters'),
    type: z.enum(['individual', 'business', 'vessel', 'aircraft']),
    country: ofacCountrySchema.optional(),
    additionalInfo: secureText(500).optional(),
  }))
    .min(1, 'At least one entity is required for batch processing')
    .max(1000, 'Maximum 1000 entities allowed per batch'),

  processingOptions: z.object({
    notifyOnCompletion: z.boolean().default(true),
    notificationEmail: z.string().email().optional(),
    priority: z.enum(['low', 'normal', 'high']).default('normal'),
    includeDetailedResults: z.boolean().default(true),
  }).optional().default({}),
})

// OFAC review decision validation schema
export const ofacReviewSchema = z.object({
  screeningId: secureText(50).refine(val => val.length >= 1, 'Screening ID is required'),

  decision: z.enum([
    'approve',
    'deny',
    'escalate',
    'request_more_info'
  ], { errorMap: () => ({ message: 'Please select a valid review decision' }) }),

  reviewNotes: secureText(2000)
    .refine(val => val.length >= 10, 'Review notes must be at least 10 characters'),

  riskRating: z.enum([
    'low',
    'medium',
    'high',
    'critical'
  ], { errorMap: () => ({ message: 'Please select a valid risk rating' }) }),

  followUpRequired: z.boolean().default(false),

  followUpDate: z.string()
    .regex(/^\d{4}-\d{2}-\d{2}$/, 'Follow-up date must be in YYYY-MM-DD format')
    .optional()
    .refine((date, ctx) => {
      if (ctx.parent.followUpRequired && !date) {
        return false
      }
      if (date) {
        const followUpDate = new Date(date)
        const today = new Date()
        today.setHours(0, 0, 0, 0)
        return followUpDate >= today
      }
      return true
    }, 'Follow-up date must be today or in the future when follow-up is required'),

  escalationReason: secureText(500).optional(),

  attachments: z.array(z.object({
    filename: secureText(255),
    size: z.number().max(10485760, 'File size must not exceed 10MB'), // 10MB limit
    type: z.enum(['pdf', 'doc', 'docx', 'txt', 'jpg', 'png']),
  }))
    .max(5, 'Maximum 5 attachments allowed')
    .optional()
    .default([]),
}).refine(
  (data) => {
    // If escalating, escalation reason is required
    if (data.decision === 'escalate' && !data.escalationReason) {
      return false
    }
    return true
  },
  {
    message: 'Escalation reason is required when escalating a case',
    path: ['escalationReason']
  }
)

// Type exports for TypeScript
export type OFACScreeningData = z.infer<typeof ofacScreeningSchema>
export type OFACMonitoringData = z.infer<typeof ofacMonitoringSchema>
export type OFACBatchData = z.infer<typeof ofacBatchSchema>
export type OFACReviewData = z.infer<typeof ofacReviewSchema>

import { useCallback, useRef, useState, useActionState, useEffect, useTransition } from 'react'
import { UseFormReturn } from 'react-hook-form'
import { toast } from 'sonner'
import { SubmissionManager, Debouncer } from '@/lib/schemas'
import { useCsrfToken } from '@/hooks/use-csrf-token'

interface UseSecureFormSubmissionOptions<TFormData, TResult> {
  /** The form instance from React Hook Form */
  form: UseFormReturn<TFormData>
  /** The server action to call */
  action: (prevState: { success: boolean; data: TResult | null; error: string | null }, formData: FormData) => Promise<TResult>
  /** Unique identifier for this form (used for debouncing and submission tracking) */
  formId: string
  /** Debounce delay in milliseconds (default: 300ms) */
  debounceDelay?: number
  /** Whether to show success/error toasts automatically */
  showToasts?: boolean
  /** Custom success message or function to generate it */
  successMessage?: string | ((result: TResult) => string)
  /** Custom error message or function to generate it */
  errorMessage?: string | ((error: string) => string)
  /** Callback fired on successful submission */
  onSuccess?: (result: TResult) => void
  /** Callback fired on submission error */
  onError?: (error: string) => void
  /** Transform form data before submission */
  transformFormData?: (data: TFormData) => Record<string, unknown>
  /** Whether to reset form on successful submission */
  resetOnSuccess?: boolean
  /** Whether to require CSRF token (default: true) */
  requireCsrf?: boolean
}

interface SecureFormSubmissionResult<TFormData, TResult> {
  /** Whether the form is currently being submitted */
  isSubmitting: boolean
  /** Whether there's a pending debounced submission */
  isPending: boolean
  /** The current submission state from useActionState */
  submissionState: {
    success: boolean
    data: TResult | null
    error: string | null
  }
  /** Submit handler for the form */
  handleSubmit: (data: TFormData) => void
  /** Direct submission handler (bypasses debouncing) */
  handleDirectSubmit: (data: TFormData) => void
  /** Cancel any pending submission */
  cancelSubmission: () => void
  /** Reset submission state */
  resetSubmission: () => void
  /** Form action for use with form action attribute */
  formAction: (formData: FormData) => void
}

export function useSecureFormSubmission<TFormData extends Record<string, unknown>, TResult extends Record<string, unknown>>({
  form,
  action,
  formId,
  debounceDelay = 300,
  showToasts = true,
  successMessage,
  errorMessage,
  onSuccess,
  onError,
  transformFormData,
  resetOnSuccess = false,
  requireCsrf = true,
}: UseSecureFormSubmissionOptions<TFormData, TResult>): SecureFormSubmissionResult<TFormData, TResult> {

  const [isLocalSubmitting, setIsLocalSubmitting] = useState(false)
  const [isPending, setIsPending] = useState(false)
  const submissionIdRef = useRef<string | null>(null)

  // Get CSRF token from session
  const { token: csrfToken, loading: csrfLoading } = useCsrfToken()

  // Use React transition for server actions
  const [isTransitionPending, startTransition] = useTransition()

  // Use Next.js useActionState for server action handling
  const [state, formAction, isActionPending] = useActionState(action, {
    success: false,
    data: null,
    error: null,
  })

  // Combined submission state
  const isSubmitting = isLocalSubmitting || isActionPending || SubmissionManager.isSubmitting(formId)

  // Handle state changes from server action
  // CRITICAL: Dependencies must be stable to prevent infinite loops
  // The effect only depends on state changes, not the callback functions themselves
  useEffect(() => {
    if (state.success && state.data) {
      // Success handling
      setIsLocalSubmitting(false)
      setIsPending(false)
      SubmissionManager.completeSubmission(formId)

      if (showToasts) {
        const message = typeof successMessage === 'function'
          ? successMessage(state.data)
          : successMessage || 'Operation completed successfully'

        toast.success('Success', { description: message })
      }

      if (resetOnSuccess) {
        form.reset()
      }

      onSuccess?.(state.data)
    } else if (state.error) {
      // Error handling
      setIsLocalSubmitting(false)
      setIsPending(false)
      SubmissionManager.completeSubmission(formId)

      if (showToasts) {
        const message = typeof errorMessage === 'function'
          ? errorMessage(state.error)
          : errorMessage || state.error

        toast.error('Error', { description: message })
      }

      onError?.(state.error)
    }
    // eslint-disable-next-line react-hooks/exhaustive-deps
  }, [state.success, state.error, state.data, formId, showToasts, resetOnSuccess])

  // Create FormData from form values
  const createFormData = useCallback((data: TFormData): FormData => {
    const transformedData = transformFormData ? transformFormData(data) : data
    const formData = new FormData()

    // Add CSRF token first (security best practice) - only if required
    if (requireCsrf && csrfToken) {
      formData.append('csrfToken', csrfToken)
    }

    Object.entries(transformedData).forEach(([key, value]) => {
      if (value !== null && value !== undefined) {
        if (typeof value === 'object' && !(value instanceof File)) {
          formData.append(key, JSON.stringify(value))
        } else {
          formData.append(key, String(value))
        }
      }
    })

    return formData
  }, [transformFormData, csrfToken, requireCsrf])

  // Direct submission handler (no debouncing)
  const handleDirectSubmit = useCallback(async (data: TFormData) => {
    // Prevent submission if already submitting
    if (isSubmitting) {
      console.warn('Form submission already in progress')
      return
    }

    // Prevent submission if CSRF token is not loaded (only if required)
    if (requireCsrf && csrfLoading) {
      console.warn('CSRF token still loading, please wait')
      if (showToasts) {
        toast.warning('Security validation in progress', { description: 'Please wait a moment...' })
      }
      return
    }

    // Prevent submission if CSRF token is missing (only if required)
    if (requireCsrf && !csrfToken) {
      console.error('CSRF token not available')
      if (showToasts) {
        toast.error('Security Error', { description: 'Security token missing. Please refresh the page.' })
      }
      return
    }

    // Generate unique submission ID
    const submissionId = `${formId}_${Date.now()}_${crypto.getRandomValues(new Uint8Array(6)).reduce((acc, byte) => acc + byte.toString(36).padStart(2, '0'), '').slice(0, 9)}`
    submissionIdRef.current = submissionId

    try {
      setIsLocalSubmitting(true)

      // Create submission promise with proper cleanup
      const formData = createFormData(data)
      let timeoutId: NodeJS.Timeout | null = null

      const submissionPromise = new Promise<void>((resolve, reject) => {
        // Use a timeout to handle the async nature of server actions
        timeoutId = setTimeout(() => {
          timeoutId = null
          resolve()
        }, 100)

        // Call the form action inside a transition (React 19 requirement)
        try {
          startTransition(() => {
            formAction(formData)
          })
          if (timeoutId) {
            clearTimeout(timeoutId)
            timeoutId = null
          }
          resolve()
        } catch (error) {
          if (timeoutId) {
            clearTimeout(timeoutId)
            timeoutId = null
          }
          reject(error)
        }
      })

      // Register with submission manager
      await SubmissionManager.startSubmission(submissionId, submissionPromise)

    } catch (error) {
      setIsLocalSubmitting(false)
      SubmissionManager.completeSubmission(submissionId)

      const errorMsg = error instanceof Error ? error.message : 'Submission failed'

      if (showToasts) {
        toast.error('Submission Error', { description: errorMsg })
      }

      onError?.(errorMsg)
    }
  }, [isSubmitting, formId, createFormData, formAction, showToasts, onError, csrfToken, csrfLoading, requireCsrf])

  // Debounced submission handler
  const handleSubmit = useCallback((data: TFormData) => {
    // Set pending state immediately
    setIsPending(true)

    // Create debounced submission
    const debouncedSubmit = Debouncer.debounce(
      `${formId}_submit`,
      (formData: TFormData) => {
        setIsPending(false)
        handleDirectSubmit(formData)
      },
      debounceDelay
    )

    debouncedSubmit(data)
  }, [formId, debounceDelay, handleDirectSubmit])

  // Cancel submission handler
  const cancelSubmission = useCallback(() => {
    setIsPending(false)
    setIsLocalSubmitting(false)
    Debouncer.cancel(`${formId}_submit`)

    if (submissionIdRef.current) {
      SubmissionManager.completeSubmission(submissionIdRef.current)
      submissionIdRef.current = null
    }
  }, [formId])

  // Reset submission state
  const resetSubmission = useCallback(() => {
    cancelSubmission()
    // Note: We can't reset the useActionState state directly
    // The parent component would need to handle this if needed
  }, [cancelSubmission])

  // Custom form action wrapper
  const wrappedFormAction = useCallback((formData: FormData) => {
    // This is called when using the form action attribute
    // We still want to prevent duplicate submissions
    if (isSubmitting) {
      console.warn('Form action submission already in progress')
      return
    }

    setIsLocalSubmitting(true)
    startTransition(() => {
      formAction(formData)
    })
  }, [isSubmitting, formAction, startTransition])

  // Cleanup on unmount
  useEffect(() => {
    return () => {
      cancelSubmission()
    }
  }, [cancelSubmission])

  return {
    isSubmitting,
    isPending,
    submissionState: state,
    handleSubmit,
    handleDirectSubmit,
    cancelSubmission,
    resetSubmission,
    formAction: wrappedFormAction,
  }
}

