// Simplified OFAC API Routes for Fastify
import { FastifyInstance, FastifyRequest, FastifyReply } from 'fastify';
import { OFACService, ScreeningRequest } from '../../services/ofac';
import { db } from '../../db';
import { ofacScreeningResults, merchants } from '../../db/schema-ofac';
import { eq, desc, and, gte, lte, sql } from 'drizzle-orm';
import { z } from 'zod';

const ofacService = new OFACService();

// Validation schemas
const screeningSchema = z.object({
  merchantId: z.string().uuid().optional(),
  searchType: z.enum(['business', 'individual']).optional().default('business'),

  // Business fields
  businessName: z.string().min(1).optional(),
  businessType: z.string().optional(),
  primaryContact: z.string().optional(),

  // Individual fields
  individualName: z.string().min(1).optional(),
  dateOfBirth: z.string().optional(),
  placeOfBirth: z.string().optional(),
  nationality: z.string().optional(),
  citizenship: z.string().optional(),

  // Common fields
  country: z.string().optional(),
  additionalNames: z.array(z.string()).optional(),
  addresses: z.array(z.object({
    street: z.string(),
    city: z.string(),
    state: z.string().optional(),
    postalCode: z.string().optional(),
    country: z.string(),
  })).optional(),
  identifiers: z.array(z.object({
    type: z.enum(['tax_id', 'registration_number', 'license_number', 'passport', 'national_id', 'ssn', 'other']),
    value: z.string(),
    country: z.string().optional(),
  })).optional(),

  // Legacy support
  principals: z.array(z.object({
    id: z.string(),
    firstName: z.string().min(1),
    middleName: z.string().optional(),
    lastName: z.string().min(1)
  })).optional()
});

const syncSchema = z.object({
  force: z.boolean().optional()
});

export default async function ofacRoutes(server: FastifyInstance) {
  // Rate limiting for OFAC operations
  const screeningRateLimit = {
    config: {
      rateLimit: {
        max: 20,
        timeWindow: '1 minute'
