    51  businessName: string;
    52  status: 'CLEAR' | 'POTENTIAL_MATCH' | 'BLOCKED';
    53  hasMatch: boolean;
    54  matches: ScreeningMatch[];
    55  principalResults: PrincipalResult[];
    56  screenedAt: Date;
    57}
    58
    59export interface ScreeningMatch {
    60  entityId: string;
    61  entityType: string;
    62  primaryName: string;
    63  programs: string[];
    64  matchType: 'EXACT' | 'ALIAS';
    65  matchedText: string;
    66}
    67
    68export interface PrincipalResult {
    69  principalId: string;
    70  principalName: string;
    71  status: 'CLEAR' | 'POTENTIAL_MATCH' | 'BLOCKED';
    72  matches: ScreeningMatch[];
    73}
    74
    75/**
    76 * Simplified OFAC Screening Service
    77 * - Exact match only (case-insensitive, normalized)
    78 * - Simple status: CLEAR, POTENTIAL_MATCH, BLOCKED
    79 * - No fuzzy matching algorithms
    80 * - Manual review for potential matches
    81 */
    82export class OFACScreeningService {
    83
    84  /**
    85   * Screen a merchant/individual against OFAC sanctions list
    86   * Supports flexible search with multiple criteria
    87   * Uses batch query optimization to avoid N+1 pattern
    88   * Uses transaction to ensure screening result is stored atomically
    89   */
    90  async screenMerchant(request: ScreeningRequest): Promise<ScreeningResult> {
    91    logger.info(`Starting OFAC screening for: ${request.merchantId}`);
    92
    93    try {
    94      // Prepare all names for batch screening
    95      const namesToScreen: string[] = [];
    96      const principalNameMap: Map<string, Principal> = new Map();
    97
    98      // Determine search type and primary name
    99      const searchType = request.searchType || 'business';
   100      let primaryName = '';
   101
   102      if (searchType === 'business' && request.businessName) {
   103        primaryName = request.businessName;
   104        namesToScreen.push(request.businessName);
   105      } else if (searchType === 'individual' && request.individualName) {
   106        primaryName = request.individualName;
   107        namesToScreen.push(request.individualName);
   108      }
   109
   110      // Add additional names if provided
   111      if (request.additionalNames) {
   112        for (const name of request.additionalNames) {
   113          if (name && name.trim().length >= 2) {
